import Imagen from './imagens/image.jpg';
import './App.css';
import Nave from './navebar/Navebar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p><Nave/></p>
        <img src={Imagen} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
